function I = fcnK1M(S, T, u, alpha, F, tol)
t1 = sqrt(-alpha);t3 = 0.1e1 ./ alpha .* t1;t4 = -alpha + u;t5 = 0.1e1 ./ t4;t6 = F - t1;t7 = 0.1e1 ./ t6;t9 = t6 .^ 2;t10 = t6 .* t1;t13 = sqrt(t9 + 0.2e1 .* t10 - alpha + u);t14 = 0.1e1 ./ t13;t18 = t4 .^ 2;t19 = 0.1e1 ./ t18;t22 = t19 .* t1;t24 = 0.1e1 ./ u .* F;t25 = t14 .* t24;t28 = sqrt(t4);t30 = 0.1e1 ./ t28 ./ t18;t34 = log(0.2e1 .* t7 .* (t13 .* t28 - alpha + t10 + u));t37 = t5 .* t3;t40 = F + t1;t41 = 0.1e1 ./ t40;t43 = t40 .^ 2;t44 = t40 .* t1;t47 = sqrt(t43 - 0.2e1 .* t44 - alpha + u);t48 = 0.1e1 ./ t47;t54 = t48 .* t24;t60 = log(0.2e1 .* t41 .* (t47 .* t28 - alpha - t44 + u));t65 = t14 .* t7 .* t5 .* t3 ./ 0.4e1 - 0.3e1 ./ 0.4e1 .* t14 .* t19 + 0.3e1 ./ 0.4e1 .* t25 .* t22 + 0.3e1 ./ 0.4e1 .* t34 .* t30 + t25 .* t37 ./ 0.2e1 - t48 .* t41 .* t5 .* t3 ./ 0.4e1 - 0.3e1 ./ 0.4e1 .* t48 .* t19 - 0.3e1 ./ 0.4e1 .* t54 .* t22 + 0.3e1 ./ 0.4e1 .* t60 .* t30 - t54 .* t37 ./ 0.2e1;
I = t65(:,:,2) - t65(:,:,1);

end
